import { Row, Container } from "reactstrap";
import './Navbar.css';
import './Navbar.scss';
import { Button, Nav, Navbar, NavDropdown } from 'react-bootstrap';
import image from "../assets/home_bg_img.png"; 

const NavbarComponent=() => {
    return ( 

    //     <div style={{ backgroundImage:`url(${image})`,backgroundRepeat:"no-repeat",backgroundSize:"contain", 
    // height:600,width:600
    // }}>
    //   Hello World
    // </div>
    
        <Navbar bg="custom-color" expand="lg" fixed="top">
      <Container>
        <Navbar.Brand href="" className="text-white">Tom & Journey logo</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
          <Nav className="justify-content-between Basic-nav-bar">
            <Nav.Link href="" className="text-white  custom-size-1" id="custom-font-bold-1">Home</Nav.Link>
            <Nav.Link href="" className="text-white  custom-size-1" id="custom-font-medium-1">Trip Planner</Nav.Link>
            <Nav.Link href="" className="text-white custom-size-1" id="custom-font-medium-1">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
   
    );
    
    
}

export default NavbarComponent;
